import React from "react";
import PropTypes from "prop-types";
import styled from "styled-components";

const Id = styled.h1``;

const ExercisePresenter = id => {
  ExercisePresenter.propTypes = {
    id: PropTypes.string
  };
  return <Id>{}</Id>;
};

export default ExercisePresenter;
